    // The same key used during encryption (keep this secret-ish)
    const KEY = "my-secret-key";

    function b64ToUint8Array(b64){
      const bin = atob(b64);
      const arr = new Uint8Array(bin.length);
      for (let i = 0; i < bin.length; i++) arr[i] = bin.charCodeAt(i);
      return arr;
    }

    function xorDecode(bytes, keyStr){
      const key = Array.from(keyStr).map(c=>c.charCodeAt(0));
      const out = new Uint8Array(bytes.length);
      for (let i = 0; i < bytes.length; i++){
        out[i] = bytes[i] ^ key[i % key.length];
      }
      return out;
    }

    try {
      const enc = b64ToUint8Array(B64);
      const dec = xorDecode(enc, KEY);
      const decoder = new TextDecoder();
      const html = decoder.decode(dec);

      // Replace current document with decoded HTML
      document.open();
      document.write(html);
      document.close();
    } catch (e) {
      // fallback - show error so it's not silent failure
      document.body.innerHTML = "<pre style='white-space:pre-wrap;padding:20px;font-family:system-ui;color:#b00'>Gagal memuat halaman (decode error):\n" + String(e) + "</pre>";
